import logo from "../../img/logo.svg"
import styled from "styled-components";

const LogoContainer = styled.div`
    display: flex;
    font-size: 30px;
`

function Logo(){
    return(
        <div className='logo'>
            <img className="logoImg" src={logo} alt="logo"></img>
            <p><strong>Ts217Books</strong></p>
        </div>
    );
}

export default Logo
